import { Button, TextField } from "@mui/material";
import deliverLogo from "../assets/deliverLogo.png";
import deliverTitle from "../assets/deliverTitle.png";
import { useState } from "react";

const SignUp = () => {
  const [id, setId] = useState("");
  const [password, setPassword] = useState("");

  const handleLogin = (event) => {
    event.preventDefault();
    console.log(id);
    console.log(password);
    //TODO: 로그인 api 로직 구현 필요
  };

  return (
    <div class="h-screen w-fit mx-auto flex items-center">
      <div class="flex justify-between w-fit gap-16">
        <div class="flex flex-col w-fit gap-8">
          <p class="text-blueLight text-5xl">회원가입</p>
          <p>
            계정을 가지고 있으신가요? <br />
            <a href="/signup" class="text-blueDark">
              로그인
            </a>
            을 진행해주세요
          </p>

          <div class="flex flex-col w-80 mb-8 gap-4">
            <TextField
              id="username"
              label="사용자 이름을 작성해주세요"
              variant="standard"
              onChange={(e) => setId(e.target.value)}
            />
            <TextField
              id="phoneNumber"
              label=" '-' 를 포함하여 휴대폰 번호를 입력해주세요."
              variant="standard"
              onChange={(e) => setPassword(e.target.value)}
            />
            <div class="flex w-full items-center">
              <div class="w-3/5">
                <TextField
                  id="phoneNumber"
                  label="주소를 입력해주세요"
                  variant="standard"
                  onChange={(e) => setPassword(e.target.value)}
                  size="large"
                />
              </div>
              <div class="w-2/5">
                <Button type="submit">주소찾기</Button>
              </div>
            </div>
          </div>
          <Button
            variant="contained"
            type="submit"
            onClick={handleLogin}
            size="small"
          >
            Login
          </Button>
        </div>
      </div>
    </div>
  );
};
export default SignUp;
